import requests

url = "https://real-estate12.p.rapidapi.com/listings/rent"
querystring = {"city": city, "state": state, "sort": sort, "price_h": price_h, "page": page}

headers = {
    "X-RapidAPI-Key": "SIGN-UP-FOR-KEY",
    "X-RapidAPI-Host": "real-estate12.p.rapidapi.com"
}

response = requests.get(url, headers=headers, params=querystring)

print(response.json())

